<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <meta http-equiv="X-UA-Compatible" content="ie=edge" />
    <title>Generator</title>
  </head>
  <body>
    <script>
      function* foo() {
        yield 233;
        yield 666;
        return 888;
      }
      let hw = foo();
      console.log(hw.next());
      console.log(hw.next());
      console.log(hw.next());
      console.log(hw.next());
    </script>
  </body>
</html>
